import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import img1 from '../Images/logo.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTachometerAlt, faArrowUp, faArrowDown, faUser, faSignOutAlt, faRocket, faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';
import styles from '../Styles/Sidebar.module.css'; // Import CSS module

const Sidebar = ({ children }) => {
  const [profileMenuOpen, setProfileMenuOpen] = useState(false);
  const [userData, setUserData] = useState({});
  const navigate = useNavigate();

  useEffect(() => {
    const data = JSON.parse(localStorage.getItem('loginDetails')).data;
    setUserData(data);
  }, []);

  const toggleProfileMenu = () => {
    setProfileMenuOpen(!profileMenuOpen);
  };

  const handleLogout = () => {
    localStorage.clear(); // Clear all local storage
    navigate('/signup'); // Redirect to login page
  };

  return (
    <div className={styles.Main}>
      <div className={styles.layout}>
        <div className={styles.userProfile} onClick={toggleProfileMenu}>
          <FontAwesomeIcon icon={faUser} className={styles.profileIcon} />
          <span className={styles.userName}><strong>&nbsp; {userData.companyName}&nbsp; </strong></span>
          {profileMenuOpen && (
            <div className={styles.profileMenu}>
              <button className={styles.logoutButton} onClick={handleLogout}>
                <FontAwesomeIcon icon={faSignOutAlt} />
                <span><strong> &nbsp; Logout</strong></span>
              </button>
            </div>
          )}
        </div>
        <aside className={styles.sidebar}>
          <div className={styles.sidebarLogo}>
            <img src={img1} alt="Logo" className={styles.logoImage} />
          </div>
          <ul className={styles.sidebarMenu}>
            <li>
              <Link to="/">
                <FontAwesomeIcon icon={faRocket} />
                <span className={styles.menuText}>Deployment</span>
              </Link>
            </li>
            <li>
              <Link to="/dashboard">
                <FontAwesomeIcon icon={faTachometerAlt} />
                <span className={styles.menuText}>Dashboard</span>
              </Link>
            </li>
            <li>
              <Link to="/scaleup">
                <FontAwesomeIcon icon={faArrowUp} />
                <span className={styles.menuText}>&nbsp;Scale Up</span>
              </Link>
            </li>
            <li>
              <Link to="/scaledown">
                <FontAwesomeIcon icon={faArrowDown} />
                <span className={styles.menuText}>&nbsp;Scale Down</span>
              </Link>
            </li>
            <li>
              <Link to="/cloudsiem">
                <FontAwesomeIcon icon={faMagnifyingGlass} />
                <span className={styles.menuText}>&nbsp;SIEM</span>
              </Link>
            </li>
          </ul>
        </aside>
      </div>
    </div>
  );
};

export default Sidebar;
